import { all, fork, takeLatest, call, put, take } from 'redux-saga/effects'
import {
    LOG_IN,
    LOG_IN_SUCCESS,
    LOG_IN_FAILURE
} from '../reducers/user'

function loginApi() {

}

function* login() {
    try {
        yield call(loginApi)
        yield put({
            type: LOG_IN_SUCCESS
        })
    } catch (e) {
        console.error(e)
        yield put({
            type: LOG_IN_FAILURE
        })
    }
}

function* watchLogin() {
    yield takeLatest(LOG_IN, login)
}

function* hellowSaga() {
    console.log('hi')
    yield 'bye'
}

export default function* userSaga() {
    yield all([
        fork(watchLogin),
        hellowSaga()
    ])
}
